import React, { useContext, useEffect, useState } from "react";
import { UserContext } from "../context/UserProvider";

const JornadasClasification = ({ weekly }) => {
  const { getTeam } = useContext(UserContext);
  const [weekSelected, setWeekSelected] = useState(weekly.length);

  if(weekSelected !== 0){
    console.log(weekSelected, weekly[weekSelected - 1]);
  }else{
    console.log(weekly.length, weekly[weekly.length - 1]);
  }

  console.log( weekly[weekly.length - 1].position7);

  const fetchTeams = async () => {
    getTeam();
  };

  useEffect(() => {
    fetchTeams();
  }, []);

  return (
    <div className="informationTable">
      <h2>CLASIFICACIÓN GASTOS POR JORNADAS</h2>
      <div className="weeklySelector">
        <select
          onChange={(selection) => setWeekSelected(selection.target.value)}
        >
          {weekly.map((week) => {
            return (
              <option selected={week.id === weekly.length} value={week.id}>
                Jornada {week.id}
              </option>
            );
          })}
        </select>
      </div>
      <div>
        <div className="tableHeader">
          <div className="teamColumn">Puesto</div>
          <div className="moneyColumn">Equipo</div>
        </div>
        <div>
          {/* POSITION 7 */}
          <div key={7}>
            <div className="tableBody">
              {/* <div className="teamColumn">{team?.name}</div> */}
              {/* <div className="moneyColumn">{team?.moneySpent}€</div> */}
            </div>
          </div>
          {/* POSITION 8 */}
          <div key={8}>
            <div className="tableBody">
              {/* <div className="teamColumn">{team?.name}</div>
              <div className="moneyColumn">{team?.moneySpent}€</div> */}
            </div>
          </div>
          {/* POSITION 9 */}
          <div key={9}>
            <div className="tableBody">
              {/* <div className="teamColumn">{team?.name}</div>
              <div className="moneyColumn">{team?.moneySpent}€</div> */}
            </div>
          </div>
          {/* POSITION 10 */}
          <div key={10}>
            <div className="tableBody">
              {/* <div className="teamColumn">{team?.name}</div>
              <div className="moneyColumn">{team?.moneySpent}€</div> */}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default JornadasClasification;
